 –≥–æ –¥–æ–≤–µ–ª–µ $userName –¥–æ —Å–µ–≥–∞—à–Ω–∞—Ç–∞ —Å–∏—Ç—É–∞—Ü–∏—ò–∞.\n7) –°–≤–µ—Å–Ω–æ ‚Äî $consciousCard (45-55 –∑–±–æ—Ä–æ–≤–∏): —Ü–µ–ª–∏, –æ—á–µ–∫—É–≤–∞—ö–∞ –∏–ª–∏ –æ–Ω–∞ —à—Ç–æ $userName –≥–æ –æ—Å–æ–∑–Ω–∞–≤–∞.\n8) –ë–ª–∏—Å–∫–∞ –∏–¥–Ω–∏–Ω–∞ ‚Äî $hiddenCard (45-55 –∑–±–æ—Ä–æ–≤–∏): –≤–µ—Ä–æ—ò–∞—Ç–µ–Ω —Ä–∞–∑–≤–æ—ò –≤–æ –Ω–∞—Ä–µ–¥–Ω–∏—Ç–µ –Ω–µ–¥–µ–ª–∏.\n9) –í–Ω–∞—Ç—Ä–µ—à–Ω–æ –à–∞—Å ‚Äî $selfCard (45-55 –∑–±–æ—Ä–æ–≤–∏): —Å–æ—Å—Ç–æ—ò–±–∞, —Ä–µ—Å—É—Ä—Å–∏ –Ω–∞ $userName.\n10) –û–ø–∫—Ä—É–∂—É–≤–∞—ö–µ ‚Äî $environmentCard (45-55 –∑–±–æ—Ä–æ–≤–∏): –≤–ª–∏—ò–∞–Ω–∏–µ –Ω–∞ –ª—É—ì–µ –∏ –æ–∫–æ–ª–Ω–æ—Å—Ç–∏.\n11) –ù–∞–¥–µ–∂–∏ / —Å—Ç—Ä–∞–≤–æ–≤–∏ ‚Äî $hopesCard (45-55 –∑–±–æ—Ä–æ–≤–∏): –æ—á–µ–∫—É–≤–∞—ö–∞ –∏–ª–∏ —Å—Ç—Ä–∞–≤–æ–≤–∏ –Ω–∞ $userName.\n12) –ò—Å—Ö–æ–¥ ‚Äî $outcomeCard (45-55 –∑–±–æ—Ä–æ–≤–∏): –≤–µ—Ä–æ—ò–∞—Ç–µ–Ω —Ä–µ–∑—É–ª—Ç–∞—Ç —Å–æ –∑–µ–º–µ–Ω–∏ –ø—Ä–µ–¥–≤–∏–¥ —Å–æ–≤–µ—Ç–∏—Ç–µ –æ–¥ —Ä–∞—Å–ø–æ—Ä–µ–¥–æ—Ç.\n13) –ó–∞–∫–ª—É—á–æ–∫: –ø—Ä–∏—ò–∞—Ç–µ–ª—Å–∫–∞ –ø–æ–¥–¥—Ä—à–∫–∞ –∏ –ø–æ–∑–∏—Ç–∏–≤–Ω–∞ –∞—Ñ–∏—Ä–º–∞—Ü–∏—ò–∞ (30-35 –∑–±–æ—Ä–æ–≤–∏) –∑–∞ $userName.\n–ü–æ—Ç—Ä–µ–±–Ω–æ: –≤–∫—É–ø–µ–Ω –æ–±–µ–º 400-500 –∑–±–æ—Ä–æ–≤–∏, –∂–∏–≤ —Ä–∞–∑–≥–æ–≤–æ—Ä–µ–Ω —Ç–æ–Ω, 4-6 –µ–∑–æ—Ç–µ—Ä–∏—á–Ω–∏ –µ–º–æ—Ç–∏–∫–æ–Ω–∏; —Å–µ–∫–æ—ò –±–ª–æ–∫ –æ–¥–¥–µ–ª–∏ —Å–æ –¥–≤–æ–µ–Ω –Ω–æ–≤ —Ä–µ–¥ (\n); –Ω–µ –∫–æ—Ä–∏—Å—Ç–∏ —Å–∏–º–±–æ–ª–∏ *, # –∏–ª–∏ –¥—Ä—É–≥–∞ —Ä–∞–∑–ª–∏–∫–∞; –ø–∏—à–∏ —Å–∞–º–æ –æ–±–∏—á–µ–Ω —Ç–µ–∫—Å—Ç.';
