—Ä–∞–∫–∞ —Å–æ 2‚Äì3 –µ–º–æ—Ç–∏–∫–æ–Ω–∏.\n–ü–æ—Ç—Ä–µ–±–Ω–æ: —Å–µ–∫–æ—ò –¥–µ–ª 2‚Äì3 —Ä–µ—á–µ–Ω–∏—Ü–∏; –º–µ—ì—É –¥–µ–ª–æ–≤–∏—Ç–µ —Å—Ç–∞–≤–∞—ò –¥–≤–æ–µ–Ω –ø—Ä–µ–≤–æ–¥ –Ω–∞ —Ä–µ–¥ (\\n\\n); –Ω–µ –∫–æ—Ä–∏—Å—Ç–∏ —Å–∏–º–±–æ–ª–∏ *, # –∏–ª–∏ –¥—Ä—É–≥–∞ —Ä–∞–∑–ª–∏–∫–∞.';
